import React, { memo } from "react";

import LJTopBanner from "./c-cpns/top-banner";

import {
  RecommendWrapper,
  Content,
  RecommendLeft,
  RecommendRight,
} from "./style";

function LJRecommend(props) {
  return (
    <RecommendWrapper>
      <LJTopBanner />
    </RecommendWrapper>
  );
}

export default memo(LJRecommend);
